import React from 'react';
import { View } from 'react-native';
import { Icon, Footer, FooterTab, Button } from 'react-native-elements';

const FooterScreen = () => {
  return (
    <View>

    {/* // <Footer> */}
      {/* <FooterTab> */}
        <Button
          type="clear"
          icon={<Icon name="home" type="font-awesome" color="white" />}
          title="Home"
        />
        <Button
          type="clear"
          icon={<Icon name="comments" type="font-awesome" color="white" />}
          title="Chat"
        />
        <Button
          type="clear"
          icon={<Icon name="user" type="font-awesome" color="white" />}
          title="Profile"
        />
      {/* // </FooterTab> */}
    {/* // </Footer> */}

</View>

  );
};

export default FooterScreen;
